class EventBind extends Component {

        constructor(props) {
                super(props)
        
                this.state = {
                         message:'ello'
                }
        }
        

        render() {
                return (
                        <div>
                                <div>{this.this.state.message}</div>
                              <button>clickBind</button>  
                        </div>
                )
        }
}

export default EventBind
